                \'month\' => $monthName,
                \'year\' => $year,
                \'start_date\' => $startDate,
                \'end_date\' => $endDate,
                \'total_regular_hours\' => $totalRegularHours,
                \'total_overtime_hours\' => $totalOvertimeHours,
